            </div>

            <div className="top">
                {/* <Doughnut data={data} className="chart"/>; */}
                <form>
                    <FontAwesomeIcon icon={faCalendarDays} />
                    <select id="period" name="period" aria-label="period">
                        {/* <option key="" value={}>{}</option> */}
                    </select>
                </form>
            </div>

            <div className="spendDetail">
            <Open> <h3>Food</h3>
                <p>Hidden content goes here</p>
            </Open>

                <h3>Home</h3>
                <h3>Fun</h3>
                <h3>Travel</h3>
                <h3>Health</h3>
                <h3>Learn</h3>
                <h3>Shop</h3>
                <h3>Lend</h3>
                <h3>Others</h3>
            </div>
        </div>
    );
}

export default ChartSpend;
